import React, { useEffect, useState } from 'react';

const Dashboard = () => {
  const [data, setData] = useState(null);
  const [err, setErr] = useState('');

  useEffect(() => {
    fetch('http://localhost:4000/api/bdl-data')
      .then(res => res.json())
      .then(setData)
      .catch(() => setErr('Błąd pobierania danych z serwera'));
  }, []);

  return (
    <div>
      <h1>Panel użytkownika</h1>
      <p>Jesteś zalogowany!</p>
      <h2>Dane z BDL</h2>
      {err && <div style={{ color: 'red' }}>{err}</div>}
      {!data && !err && <div>Ładowanie danych...</div>}
      {data && (
        <div>
          <h3>Ceny mieszkań</h3>
          <pre style={{ maxWidth: 600, overflowX: 'auto', background: '#eee', padding: 8 }}>
            {JSON.stringify(data.housing, null, 2)}
          </pre>
          <h3>Stopy procentowe</h3>
          <pre style={{ maxWidth: 600, overflowX: 'auto', background: '#eee', padding: 8 }}>
            {JSON.stringify(data.interest, null, 2)}
          </pre>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
